  \"2016-07-27T22:54:30.216484\",\n\t\"name\": \"union-slough-national-wildlife-refuge-annual-narrative-report-july-december-1975-and-cale-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Union
  Slough NWR outlines Refuge accomplishments during the 1976 calendar year. The report
  begins with an introduction to the Refuge and information about weather conditions,
  habitat conditions, land acquisition activities, and the system status. Construction
  and maintenance are also described. Habitat management is covered; croplands, grasslands,
  wetlands, and forests are discussed. The wildlife section of the report discusses
  migratory birds, mammals, and non-migratory birds. Interpretation and recreation
  activities are outlined; topics include information and interpretation, recreation,
  and law enforcement. Field investigations, cooperative programs, items of interest,
  and safety information are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
